import React, { Component, useEffect } from 'react';
import {AddStock} from './addStock';
import {NewQuery} from './newQuery';
// import {TickSuspended} from './tickSuspended';
// import {TickToDos} from './tickToDos';
import './index.css';

export default class Vendor extends Component {
  render() {
    return (
      <>
        <Link to="first" style={{ textDecoration: 'none' }}>
          <MenuItem style={{ paddingLeft: 13 }}>Team 1</MenuItem>
        </Link>
        <style>{'body {background-color: #20154D; background-image: url("./Images/wave2.png"); background-repeat: no-repeat;}'}</style>
        <h2>¿Qué desea hacer?</h2>
        <ul className='menu-selector'>
            <AddStock />
            {/* <NewQuery /> */}
            {/*<TickSuspended />
            <TickToDo /> */}
        </ul>
      </>
    );
  }
}
